import React, { useState, useEffect } from "react";
import "./styles/summary.css";

const Summary = ({}) => {
  return (
    <div>
      <div className="summary-container">
        <div className="card">
          <p>Total win</p>
        </div>
      </div>
    </div>
  );
};

export default Summary;
